#include "common.h"
using namespace std;

namespace lastSubstring {
/*
// TODO: copy problem statement here
 1163. Last Substring in Lexicographical Order
 Hard
 
 29
 
 93
 
 Favorite
 
 Share
 Given a string s, return the last substring of s in lexicographical order.
 
 
 
 Example 1:
 
 Input: "abab"
 Output: "bab"
 Explanation: The substrings are ["a", "ab", "aba", "abab", "b", "ba", "bab"]. The lexicographically maximum substring is "bab".
 Example 2:
 
 Input: "leetcode"
 Output: "tcode"
 
 
 Note:
 
 1 <= s.length <= 10^5
 s contains only lowercase English letters.
 */

class Solution {
public:
    string lastSubstring(string s) {
        return lastSubstring_cmp(s);
        return lastSubstring_brutalforce(s);
        return lastSubstring_shrinkset(s);
        return lastSubstring_suffixtree_TLE(s);
    }
    
    // https://leetcode.com/problems/last-substring-in-lexicographical-order/discuss/363662/Short-python-code-O(n)-time-and-O(1)-space-with-proof-and-visualization
    // in case s[maxi+k] > s[j+k], and we already know that s[i+1:] to s[j-1:] are smaller than s[maxi:]
    // s[p:] (any j <p < j+k+1) < s[p+i-j:] = s[q:](i<q<p), and this chain can continue until q < j
    // and thus we know s[j:] to s[j+k] will not be candiate for max substring.
    //
    // in case s[maxi+k] < s[j+k], then any substring s[p:] (i<p<i+k+1) < s[p+j-i:]=s[q:] (j<q<j+k+1),
    // so s[p:](i<p<i+k+1) can't be candidate for max substring, i can be moved to max(j, i+k+1).
    string lastSubstring_twopinter(string s) {
        int n = s.size();
        int maxi = 0, j = 1, k = 0;
        while (j+k < n) {
            if (s[maxi+k] == s[j+k]) {
                ++k;
                continue;
            } else if (s[maxi+k] < s[j+k]) {
                maxi = max(maxi+k+1, j);
                j = maxi+1;
            } else {
                j = j+k+1;
            }
            k = 0;
        }
        return s.substr(maxi);
    }
    
    string lastSubstring_cmp(string s) {
        int n = s.size();
        int maxi = 0;
        int i = 1;
        while (i < n) {
            if (s[i] > s[maxi]) {
                maxi = i;
            } else if (s[i] == s[maxi]) {
                // have to compare next characters
                int j = maxi;
                int ori_i = i;
                int lookback_i = i+1;
                while (i < n && j < ori_i && s[i] == s[j]) {
                    if (s[i] == s[ori_i]) {
                        lookback_i = i;
                    }
                    ++i;
                    ++j;
                }
                if (i >= n || j >= ori_i || s[i] < s[j]) {
                    // it is safe to move starting position to current i.
                    continue;
                } else {
                    // TODO: how to prove that it is ok to move starting position to i?
                    // Looks like it is not safe to move.
                    maxi = ori_i;
                    i = lookback_i;
                }
            }
            
            ++i;
        }
        return s.substr(maxi);
    }
    
    string lastSubstring_test(string s) {
        int max_idx = 0;  // start index of the max_str
        int i = 1, n = s.size();
        while (i < n) {
            // If current character is larger than the first character of
            // max_str, then we update the max_str
            if (s[i] > s[max_idx]) {
                max_idx = i;
            }
            // If tied, we need to cur_str and max_str
            else if (s[i] == s[max_idx]) {
                // We compare them by two pointers i and j
                // i points to one character of cur_str, and j points to max_str
                int j = max_idx, ori_i = i;
                // If s[i] != s[j] or j == ori_i, then tie is broken
                // Otherwise we keep compare the next character
                // (by sding: when j == ori_i, it is OK to move i directly to ori_i*2-max_idx without
                // missing a possible candidate.
                //  suppose s = TXXY, where X represent (max_idx, ori_i-1) and (ori_i, ori_i*2-max_idx-1)
                //  if Y is larger than X, then move i to Y would not miss Y as possible result; else
                //  if Y is smaller than X, then XXY would be the final result.)
                int look_back_i = i;
                while (i < n && s[i] == s[j] && j < ori_i) {
                    if (s[i] == s[max_idx]) look_back_i = i;
                    i++;
                    j++;
                }
                // If the max_str is larger than cur_str, then we don't update max_str
                if ((j == ori_i) || (i == n) || (s[j] > s[i])) {
                    continue;
                }
                // update max_str
                max_idx = ori_i;
                if (look_back_i != ori_i)
                    i = look_back_i;
                continue;
            }
            // These is no tie. So we just step i
            i++;
        }
        return s.substr(max_idx);
    }
    string lastSubstring_brutalforce(string s) {
        int n = s.size();
        int maxi = 0;
        for (int j = 1; j < n; ++j) {
            int k = 0;
            for (; j+k < n; ++k) {
                if (s[maxi+k] != s[j+k]) {
                    maxi = s[maxi+k] > s[j+k] ? maxi : j;
                    break;
                }
            }
            if (j+k >= n) {
                break;
            }
        }
        return s.substr(maxi);
    }
    string lastSubstring_shrinkset(string s) {
        int n = s.size();
        vector<int> cur;
        int j = 0;
        for (int i = 1; i <= n; ++i) {
            if (i == n || s[j] != s[i]) {
                cur.push_back(j);
                if (i-1 > j) {
                    cur.push_back(i-1);
                }
                j = i;
            }
        }
        int len = 0;
        while (cur.size() > 1) {
            char maxc = 'a'-1;
            vector<int> next;
            for (auto i : cur) {
                if (i+len < n) {
                    if (s[i+len] > maxc) {
                        next.clear();
                        next.push_back(i);
                        maxc = s[i+len];
                    } else if (s[i+len] == maxc) {
                        next.push_back(i);
                    }
                }
            }
            cur.swap(next);
            ++len;
        }
        return s.substr(cur.back());
    }
    /**
     * this is the last suffix tree of s. The substring has to be a suffix.
     *
     * Use prefix doubling to sort suffix tree.
     */
    string lastSubstring_suffixtree_TLE(string s) {
        struct suft {
            int p;
            int rk1;
            int rk2;
        };
        
        int n = s.size();
        vector<int> rank(n, 0);
        vector<suft> sufarr;
        for (int i = 0; i < n; ++i) {
            sufarr.push_back({i, s[i]-'a', -1});
            rank[i] = s[i] - 'a';
        }
        
        for (int k = 1; k < n; k<<=1) {
            for (int i = 0; i < n; ++i) {
                sufarr[i].p = i;
                sufarr[i].rk1 = rank[i];
                sufarr[i].rk2 = (i+k < n) ? rank[i+k] : -1;
            }
            
            sort(sufarr.begin(), sufarr.end(), [](const suft& a, const suft& b){
                return a.rk1 != b.rk1 ? a.rk1 < b.rk1 : a.rk2 < b.rk2;
            });
            
            for (int i = 0; i < n; ++i) {
                rank[sufarr[i].p] = i;
                if (i > 0 && sufarr[i].rk1 == sufarr[i-1].rk1 && sufarr[i].rk2 == sufarr[i-1].rk2) {
                    rank[sufarr[i].p] = rank[sufarr[i-1].p];
                }
            }
        }
        
        return s.substr(sufarr[n-1].p);
    }

private:
};

}

